import { Card } from "./Card.js";

export class Matcher {
  #cards = [];
  #randoms = [];
  #shuffleCards = [];

  constructor() {
    this.setRandoms();
    this.setCards();
  }

  setRandoms() {
    const randomNumbers = new Set();

    while (randomNumbers.size < 20) {
      randomNumbers.add(this.getRandomNumber());
    }

    this.#randoms = Array.from(randomNumbers);
  }

  setCards() {
    const images = [
      "https://i.pinimg.com/236x/e9/04/c5/e904c5e5153bd1f31d60a3704a1bf3e3.jpg",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRQ5RuVHn1OBv2KfKDWbUN_a-eHXERPn44JYw&s",
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdx38W42k6ujIXAghZNamkWwcMPEXWZbb8CA&s",
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQMGxYhyig7hwlxnriVsO_28iVqRJ5df3SYSQ&s",
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQLLUcGnoLc3me7raJrbojSJyxSKVlolNBiZQ&s",
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRgkRRHqmjy6X_WoaH6N4kJIiFxDC8n5L8_IQ&s",
    ];
    const doubledImages = images.concat(images);

    for (let i = 0; i < doubledImages.length; i++) {
      const card = new Card(doubledImages[i], i);
      this.#cards.push(card);
    }
  }

  getRandomNumber() {
    return Math.floor(Math.random() * 20);
  }

  getShuffleCard() {
    this.#shuffleCards = this.#randoms.map(
      (randomIndex) => this.#cards[randomIndex]
    );
    return this.#shuffleCards;
  }
}
